="solid" border-width="1pt" border-color="#000000" padding="5pt" color="#232323">                                <fo:block font-size="11pt"><xsl:value-of select="result/atcs/datacriacao"/></fo:block>                            </fo:table-cell>                            </fo:table-row>                            <fo:table-row>                            <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                                <fo:block font-size="11pt" font-weight="bold" color="#232323" text-align="left" vertical-align="middle">                                FALECIDO                                </fo:block>                            </fo:table-cell>                                                <fo:table-cell border="solid" border-width="1pt" border-color="#000000" padding="5pt" color="#232323">                                <fo:block font-size="11pt"><xsl:value-of select="result/atcs/nome"/></fo:block>                            </fo:table-cell>                            </fo:table-row>                        <fo:table-row>                            <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                                <fo:block font-size="11pt" font-weight="bold" color="#232323" text-align="left" vertical-align="middle">                                SEGURADORA                                </fo:block>                            </fo:table-cell>                                                <fo:table-cell border="solid" border-width="1pt" border-color="#000000" padding="5pt" color="#232323">                                <fo:block font-size="11pt"><xsl:value-of select="result/atcs/cliente/nomefantasia"/></fo:block>                            </fo:table-cell>                        </fo:table-row>                    </fo:table-body>                 </fo:table>                <fo:block linefeed-treatment="preserve" text-align="left" space-before="0pt" margin-top="5mm" margin-bottom="5mm" font-weight="bold"                 color="#232323">                    DADOS DO SEGURO:                </fo:block>                <xsl:if test="(result/seguros/*)">                    <xsl:apply-templates select="result/seguros"/>                </xsl:if>                                <fo:block linefeed-treatment="preserve" text-align="left" space-before="0pt" margin-top="5mm" margin-bottom="5mm" font-weight="bold"                 color="#232323">                    DADOS DO SERVIÇO:                </fo:block>                <xsl:if test="(result/servicosorcados/*)">                    <xsl:apply-templates select="result/servicosorcados"/>                </xsl:if>                                <fo:block id="ultimapagina"> </fo:block>                                </fo:flow>            </fo:page-sequence>            </fo:root>        </xsl:template>        <!-- Dados Contatos -->        <xsl:template match="seguros">            <fo:table table-layout="fixed" width="100%">                <fo:table-column column-width="60%"/>                <fo:table-column column-width="40%"/>                <fo:table-header>                <fo:table-row>                    <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                    <fo:block font-size="11pt" font-weight="bold" color="#232323" text-align="center" vertical-align="middle">                        PRODUTO                    </fo:block>                    </fo:table-cell>                                        <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                    <fo:block font-size="11pt" font-weight="bold" color="#232323" text-align="center" vertical-align="middle">                        PROCESSO (SINISTRO)                    </fo:block>                    </fo:table-cell>                </fo:table-row>                </fo:table-header>                                <fo:table-body>                <xsl:for-each select="entry">                        <fo:table-row>                            <fo:table-cell border="solid" border-width="1pt" border-color="#000000" padding="5pt" color="#232323">                                <fo:block font-size="11pt"><xsl:value-of select="produto"/></fo:block>                        </fo:table-cell>                                <fo:table-cell border="solid" border-width="1pt" border-color="#000000" padding="5pt" color="#232323">                            <fo:block font-size="11pt"><xsl:value-of select="sinistro"/></fo:block>                            </fo:table-cell>                    </fo:table-row>                           </xsl:for-each>                </fo:table-body>            </fo:table>        </xsl:template>        <!-- Dados Serviços -->        <xsl:template match="servicosorcados">            <fo:table table-layout="fixed" width="100%" table-omit-footer-at-break="true">                <fo:table-column column-width="138mm" />                <!-- <fo:table-column column-width="30mm" />                <fo:table-column column-width="30mm" /> -->                <fo:table-column column-width="50mm" />                <fo:table-header>                <fo:table-row>                    <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                    <fo:block font-size="11pt" font-weight="bold" color="#232323" text-align="center" vertical-align="middle">                        DESCRIÇÃO DOS SERVIÇOS                    </fo:block>                    </fo:table-cell>                                    <!-- <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                    <fo:block font-size="11pt" font-weight="bold" color="#232323" text-align="center" vertical-align="middle">        