desconto_global), ''###,###0.00'')"/>                                </fo:block>                            </fo:table-cell> -->                            <fo:table-cell border="solid" border-width="1pt" border-color="#000000" padding="5pt" color="#232323">                                <fo:block font-size="11pt" text-align="right">                                        R$ <xsl:value-of select="format-number(( (valor * quantidade) - (desconto_parcial + desconto_global)), ''###,###0.00'')"/>                                </fo:block>                            </fo:table-cell>                        </fo:table-row>                       </xsl:for-each>                            <!-- <xsl:variable name="valorTotal">                        <xsl:for-each select="entry">                            <value>                                <xsl:value-of select="valor * quantidade" />                            </value>                        </xsl:for-each>                    </xsl:variable> -->                    <!-- <xsl:variable name="descontoTotal">                        <xsl:for-each select="entry">                            <value>                                <xsl:value-of select="desconto_parcial + desconto_global" />                            </value>                        </xsl:for-each>                    </xsl:variable> -->                    <xsl:variable name="totalFinal">                        <xsl:for-each select="entry">                            <value>                                <xsl:value-of select="(valor * quantidade) - (desconto_parcial + desconto_global)" />                            </value>                        </xsl:for-each>                    </xsl:variable>                    <fo:table-row>                        <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                            <fo:block font-size="11pt" font-weight="bold" text-align="left" vertical-align="middle" >                                TOTAL AUTORIZADO:                            </fo:block>                        </fo:table-cell>                                            <!-- <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                            <fo:block font-size="11pt" font-weight="bold" text-align="right" vertical-align="middle" >                                R$ <xsl:value-of select="format-number(sum(exslt:node-set($valorTotal)/value), ''###,###0.00'')"/>                            </fo:block>                        </fo:table-cell> -->                        <!-- <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                            <fo:block font-size="11pt" font-weight="bold" text-align="right" vertical-align="middle" >                                R$ <xsl:value-of select="format-number(sum(exslt:node-set($descontoTotal)/value), ''###,###0.00'')"/>                            </fo:block>                        </fo:table-cell> -->                        <fo:table-cell padding="5pt" border="solid" border-width="1pt" border-color="#000000" background-color="#ababab">                            <fo:block font-size="11pt" font-weight="bold" text-align="right" vertical-align="middle" >                                R$ <xsl:value-of select="format-number(sum(exslt:node-set($totalFinal)/value), ''###,###0.00'')"/>                            </fo:block>                        </fo:table-cell>                    </fo:table-row>                </fo:table-body>            </fo:table>        </xsl:template>        </xsl:stylesheet>');

